import{_ as a,o as e,c as o,e as i}from"./app.411e09a6.js";const t={},n=i('<h1 id="czesto-zadawane-pytania-faq" tabindex="-1"><a class="header-anchor" href="#czesto-zadawane-pytania-faq" aria-hidden="true">#</a> Cz\u0119sto zadawane pytania (FAQ)</h1><p>Ten dokument zawiera list\u0119 cz\u0119sto zadawanych pyta\u0144 na temat u\u017Cywania Misskey. Cz\u0119sto zadawane pytania na temat projektu Misskey mo\u017Cna znale\u015B\u0107 <a href="../misskey#frequently-asked-questions">tutaj</a>.</p><h2 id="czy-sa-jakies-aplikacje-na-ios-androida" tabindex="-1"><a class="header-anchor" href="#czy-sa-jakies-aplikacje-na-ios-androida" aria-hidden="true">#</a> &quot;Czy s\u0105 jakie\u015B aplikacje na iOS/Androida?&quot;</h2><p>Aktualnie nie ma oficjalnej aplikacji Misskey na urz\u0105dzenia mobilne, jest kilka aplikacji nieoficjalnych. Po wi\u0119cej informacji sprawd\u017A <a href="./apps">tutaj</a>.</p><p>Jednak\u017Ce funkcjonalno\u015B\u0107 nieoficjalnych aplikacji b\u0119dzie w tyle za oficjalnym klientem przegl\u0105darkowym, wi\u0119c tylko pod warunkiem \u017Ce chcesz u\u017Cywa\u0107 natywnej aplikacji rekomendujemy u\u017Cywa\u0107 oficjalnego przegl\u0105darkowego klienta. Przegl\u0105darkowy klient Misskey wspiera PWA wi\u0119c mo\u017Cna traktowa\u0107 go jako natywn\u0105 aplikacj\u0119. Informacje na ten temat znajdziesz <a href="todo">tutaj</a>.</p><h2 id="nie-moge-zalogowac-sie-przez-klient-do-mastodona" tabindex="-1"><a class="header-anchor" href="#nie-moge-zalogowac-sie-przez-klient-do-mastodona" aria-hidden="true">#</a> &quot;Nie mog\u0119 zalogowa\u0107 si\u0119 przez klient do Mastodona?&quot;</h2><p>Poniewa\u017C Misskey nie jest kompatybilne z API Mastodona, poza niekt\xF3rymi wyj\u0105tkami, u\u017Cywanie klient\xF3w do Mastodona \u017Ceby zalogowa\u0107 si\u0119 do Misskey jest niemo\u017Cliwe.</p><h2 id="co-musze-zrobic-zeby-obserwowac-ludzi-z-innych-serwerow" tabindex="-1"><a class="header-anchor" href="#co-musze-zrobic-zeby-obserwowac-ludzi-z-innych-serwerow" aria-hidden="true">#</a> &quot;Co musz\u0119 zrobi\u0107 \u017Ceby obserwowa\u0107 ludzi z innych serwer\xF3w?&quot;</h2><p>U\u017Cyj wyszukiwarki w menu i wpisz ich nazw\u0119 \u0142\u0105cznie z ich serwerem np. <code>@syuilo@misskey.io</code></p><h2 id="jak-usunac-repost-renotke-itp" tabindex="-1"><a class="header-anchor" href="#jak-usunac-repost-renotke-itp" aria-hidden="true">#</a> &quot;Jak usun\u0105\u0107 repost/renotk\u0119 itp.&quot;</h2><p>Kliknij w 3 kropki (&quot;...&quot;) wy\u015Bwietlone przy informacjach posta i wybierz &quot;Odbierz renotk\u0119&quot;. Aby dowiedzie\u0107 si\u0119 wi\u0119cej o Renotkach <a href="../features/note#renote">sprawd\u017A tutaj</a>.</p><h2 id="nie-chce-widziec-podgladu-z-adresu-url" tabindex="-1"><a class="header-anchor" href="#nie-chce-widziec-podgladu-z-adresu-url" aria-hidden="true">#</a> &quot;Nie chc\u0119 widzie\u0107 podgl\u0105du z adresu URL&quot;</h2><p>Mo\u017Cesz zapobiec wy\u015Bwietlaniu podgl\u0105gu adresu URL u\u017Cywaj\u0105c MFM. Prosz\u0119 sprawd\u017A Dokumentacj\u0119 MFM kt\xF3r\u0105 mo\u017Cesz zobaczy\u0107 na twojej instancji wpisuj\u0105\u0107 adres <code>https://AdresTwojejInstancji/mfm-cheat-sheet</code>.</p><h2 id="chce-dodac-dodatkowe-emotikony" tabindex="-1"><a class="header-anchor" href="#chce-dodac-dodatkowe-emotikony" aria-hidden="true">#</a> &quot;Chc\u0119 doda\u0107 dodatkowe emotikony&quot;</h2><p>Tylko administratorzy mog\u0105 doda\u0107, edytowa\u0107 lub usun\u0105\u0107 dodatkowe emotikony. Je\u017Celi chcia\u0142by\u0107 zrobi\u0107 kt\xF3r\u0105\u015B z tych czynno\u015Bci skonsultuj si\u0119 z administratorem twojej instancji.</p><h2 id="chcia\u0142bym-napisac-bota" tabindex="-1"><a class="header-anchor" href="#chcia\u0142bym-napisac-bota" aria-hidden="true">#</a> &quot;Chcia\u0142bym napisa\u0107 BOTa&quot;</h2><p>Jest mo\u017Cliwo\u015B\u0107 napisania Bota u\u017Cywaj\u0105\u0107 API Misskey. <a href="../docs/api">Zobacz wi\u0119cej</a>.</p><h2 id="jaki-t\u0142umacz-jest-uzywany-do-t\u0142umaczenia-postow" tabindex="-1"><a class="header-anchor" href="#jaki-t\u0142umacz-jest-uzywany-do-t\u0142umaczenia-postow" aria-hidden="true">#</a> Jaki t\u0142umacz jest u\u017Cywany do t\u0142umaczenia post\xF3w?</h2><p><a href="https://www.deepl.com/" target="_blank" rel="noopener noreferrer">DeepL</a> jest do tego wykorzystywany.</p>',19),r=[n];function s(d,c){return e(),o("div",null,r)}var h=a(t,[["render",s],["__file","faq.html.vue"]]);export{h as default};
